syntax = "proto3";
package fanxi;
import "RestfulBaseRequest.proto";
option java_package = "com.fanxi.service.message";
option java_outer_classname = "RegisterRequestProto";

message RegisterRequest {
   RestfulBaseRequest baseReq=1;
   string gcmId=20;
   string userName=21;
   string password=22;
   int32 partnerId=23;
   string serverChallenge=24;
   string registerToken=25;
   string variant=26;
   
}
